import './App.css';

function Input() {
    return (
        <section >
        <div className='row'> 
           <input type="text" name='english'></input>
           <input type="text" name='transcription'></input>
           <input type="text" name='russian'></input>
          <input type="text" name='boolean'></input>
          <button className= 'btn_save'>Save</button>
            <button className= 'btn'></button>
       </div>
       </section>
    );
}
export default Input
